import { NavLink } from "react-router-dom";

export default function Null() {
    return (
        <>
            <div className="Null">
                <div>
                    <i class="fa-solid fa-cart-shopping"></i>
                    <h1 className="text-center p-0 m-0">Your cart is empty!</h1>
                </div>
                <NavLink>Go to shop!</NavLink>
            </div>
        </>
    )
}
